import React, {Component} from "react";
import { MDBBreadcrumb, MDBBreadcrumbItem, Container } from "mdbreact";
import {
  BrowserRouter as Router,
  Route,
  Link,
} from 'react-router-dom'


const Home = () =>
  <div>
    <h2>Home</h2>
  </div>;

class BreadCrumbs extends Component {

render(){
// const BreadCrumbs = ()=> {
  return (
    <Router>
    <Container>

      <MDBBreadcrumb color="white pink">

        <MDBBreadcrumbItem iconRegular icon="circle"><Link to="/ShadowCat">Home</Link></MDBBreadcrumbItem>
        <MDBBreadcrumbItem iconRegular icon="circle">Library</MDBBreadcrumbItem>
        <MDBBreadcrumbItem iconSmall icon="circle" >Data</MDBBreadcrumbItem>
      </MDBBreadcrumb>
    </Container>
    </Router>
  );
};
}

export default BreadCrumbs;

